import React from 'react';

export default function Contact () {
    return (
        <main className="contact">
            <form>

                <h1>Initial Consultation</h1>
                {/* <label>First Name:</label> */}
                <input type="text"placeholder="First Name" size="50" required />
                <br />
                {/* <label>Last Name:</label> */}
                <input type="text" placeholder="Last Name" size="50" required/>
                <br />
                {/* <label type="email">E-mail:</label> */}
                <input type="email" placeholder="you@example.com" required/>
                <br />
                {/* <label type="phone">Phone Number:</label> */}
                <input type="phone" placeholder="1231231234" required/>
                <br />
                {/* <label type="address">Address:</label> */}
                <input type="addresstext" placeholder="123 Street City, State Zipcode" required/>
                <br />
                {/* <label type="textarea">Concerns:</label> */}
                <textarea area rows="4" cols="50" placeholder="Place anything you'd like to discuss here."> </textarea>
            </form>
        </main>
    )
}
